pragma solidity 0.8.13;
import { CountersUpgradeable } from "@openzeppelin/contracts-upgradeable/utils/CountersUpgradeable.sol";
import { ReentrancyGuardUpgradeable } from "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import { PausableUpgradeable } from "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import { IERC20 } from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import { Math } from "@openzeppelin/contracts/utils/math/Math.sol";
import { BlockNumber } from "../utility/BlockNumber.sol";
import { IBancorNetwork } from "../network/interfaces/IBancorNetwork.sol";
import { IMasterVault } from "../vaults/interfaces/IMasterVault.sol";
import { IVersioned } from "../utility/interfaces/IVersioned.sol";
import { Poolable, Pool } from "./Poolable.sol";
import { PPM_RESOLUTION } from "../utility/Constants.sol";
import { Sint256, MathEx, ONE } from "../utility/MathEx.sol";
import { Strategyable, Order, Trade, Strategy } from "./Strategyable.sol";
import { Token } from "../token/Token.sol";
import { Upgradeable } from "../utility/Upgradeable.sol";
import { Utils, AlreadyExists, DoesNotExist, InvalidParam, InvalidPoolCollection } from "../utility/Utils.sol";
import { IPoolCollection, Pair, SourceTargetTokens } from "./interfaces/IPoolCollection.sol";

import "hardhat/console.sol";

/**
 * @dev Pool Collection contract
 *
 * notes:
 *
 * - the address of reserve token serves as the pool unique ID in both contract functions and events
 */
contract PoolCollection is
    IPoolCollection,
    Poolable,
    Strategyable,
    Upgradeable,
    ReentrancyGuardUpgradeable,
    PausableUpgradeable,
    BlockNumber
{
    using CountersUpgradeable for CountersUpgradeable.Counter;

    uint16 private constant POOL_TYPE = 1;
    uint32 private constant DEFAULT_NETWORK_FEE_PPM = 200_000; // 20%

    // the network contract
    IBancorNetwork private immutable _network;

    // the master vault contract
    IMasterVault private immutable _masterVault;

    // the global network fee (in units of PPM)
    uint32 private _networkFeePPM;

    // upgrade forward-compatibility storage gap
    uint256[MAX_GAP - 1] private __gap;

    /**
     * @dev triggered when the network fee is updated
     */
    event NetworkFeePPMUpdated(uint32 prevFeePPM, uint32 newFeePPM);

    /**
     * @dev a "virtual" constructor that is only used to set immutable state variables
     */
    constructor(IBancorNetwork initNetwork, IMasterVault initMasterVault) {
        _validAddress(address(initNetwork));
        _validAddress(address(initMasterVault));

        _network = initNetwork;
        _masterVault = initMasterVault;
    }

    /**
     * @dev fully initializes the contract and its parents
     */
    function initialize() external initializer {
        __PoolCollection_init();
    }

    // solhint-disable func-name-mixedcase

    /**
     * @dev initializes the contract and its parents
     */
    function __PoolCollection_init() internal onlyInitializing {
        __Upgradeable_init();
        __ReentrancyGuard_init();
        __Pausable_init();

        __PoolCollection_init_unchained();
    }

    /**
     * @dev performs contract-specific initialization
     */
    function __PoolCollection_init_unchained() internal onlyInitializing {
        // set up administrative roles
        _setNetworkFeePPM(DEFAULT_NETWORK_FEE_PPM);
    }

    // solhint-enable func-name-mixedcase

    /**
     * @inheritdoc Upgradeable
     */
    function version() public pure override(IVersioned, Upgradeable) returns (uint16) {
        return 1;
    }

    /**
     * @inheritdoc IPoolCollection
     */
    function poolType() external view virtual returns (uint16) {
        return POOL_TYPE;
    }

    /**
     * @inheritdoc IPoolCollection
     */
    function networkFeePPM() external view returns (uint32) {
        return _networkFeePPM;
    }

    /**
     * @dev sets the network fee (in units of PPM)
     *
     * requirements:
     *
     * - the caller must be the admin of the contract
     */
    function setNetworkFeePPM(uint32 newNetworkFeePPM) external onlyAdmin validFee(newNetworkFeePPM) {
        _setNetworkFeePPM(newNetworkFeePPM);
    }

    /**
     * @dev sets the network fee (in units of PPM)
     */
    function _setNetworkFeePPM(uint32 newNetworkFeePPM) private {
        uint32 prevNetworkFeePPM = _networkFeePPM;
        if (prevNetworkFeePPM == newNetworkFeePPM) {
            return;
        }

        _networkFeePPM = newNetworkFeePPM;

        emit NetworkFeePPMUpdated({ prevFeePPM: prevNetworkFeePPM, newFeePPM: newNetworkFeePPM });
    }

    /**
     * @inheritdoc IPoolCollection
     */
    function createPool(Token token0, Token token1) external only(address(_network)) returns (Pool memory) {
        _validateInputTokens(token0, token1);
        return _createPool(token0, token1);
    }

    /**
     * @inheritdoc IPoolCollection
     */
    function pairs() external view only(address(_network)) returns (address[2][] memory) {
        return _pairs();
    }

    /**
     * @inheritdoc IPoolCollection
     */
    function pool(Token token0, Token token1) external view only(address(_network)) returns (Pool memory) {
        _validateInputTokens(token0, token1);
        return _pool(token0, token1);
    }

    /**
     * @inheritdoc IPoolCollection
     */
    function createStrategy(
        Token sourceToken,
        Token targetToken,
        uint128 y0, // current balance
        uint128 z0, // current balance intercept
        uint64 A0, // floor(ONE * (sqrt(high price) - sqrt(low price)))
        uint64 B0, // floor(ONE * sqrt(low price))
        uint128 y1, // current balance
        uint128 z1, // current balance intercept
        uint64 A1, // floor(ONE * (sqrt(high price) - sqrt(low price)))
        uint64 B1 // floor(ONE * sqrt(low price))
    ) external nonReentrant whenNotPaused returns (uint256) {
        _validateInputTokens(sourceToken, targetToken);

        SourceTargetTokens memory tokens = SourceTargetTokens({ source: sourceToken, target: targetToken });
        if (!_poolExists(tokens.source, tokens.target)) {
            _createPool(tokens.source, tokens.target);
        }
        Pool memory __pool = _pool(tokens.source, tokens.target);

        Order[2] memory orders = [Order({ y: y0, z: z0, A: A0, B: B0 }), Order({ y: y1, z: z1, A: A1, B: B1 })];
        return _createStrategy(address(_masterVault), tokens, orders, __pool);
    }

    /**
     * @inheritdoc IPoolCollection
     */
    function strategy(uint256 id) external view returns (Strategy memory) {
        return _strategy(id);
    }

    /**
     * @inheritdoc IPoolCollection
     */
    function strategiesByProvider(address provider) external view validAddress(provider) returns (Strategy[] memory) {
        return _strategiesByProvider(provider);
    }

    /**
     * @inheritdoc IPoolCollection
     */
    function strategiesByIds(uint256[] calldata ids) external view returns (Strategy[] memory) {
        return _strategiesByIds(ids);
    }

    /**
     * @inheritdoc IPoolCollection
     */
    function strategiesByPool(Token sourceToken, Token targetToken) external view returns (Strategy[] memory) {
        _validateInputTokens(sourceToken, targetToken);
        Pool memory __pool = _pool(sourceToken, targetToken);
        return _strategiesByPool(__pool);
    }

    /**
     * @inheritdoc IPoolCollection
     */
    function trade(
        address provider,
        Trade[] calldata trades,
        bool tradeByTargetAmount
    ) external nonReentrant whenNotPaused {
        _trade(provider, trades, tradeByTargetAmount, _masterVault);
    }
}
