pragma solidity 0.8.13;
import { CountersUpgradeable } from "@openzeppelin/contracts-upgradeable/utils/CountersUpgradeable.sol";
import { EnumerableSetUpgradeable } from "@openzeppelin/contracts-upgradeable/utils/structs/EnumerableSetUpgradeable.sol";
import { MathEx, ONE } from "../utility/MathEx.sol";
import { Utils } from "../utility/Utils.sol";
import { Token } from "../token/Token.sol";
import { TokenLibrary } from "../token/TokenLibrary.sol";
import { Pool } from "./Poolable.sol";
import { Pair, SourceTargetTokens, Trade } from "./interfaces/IPoolCollection.sol";
import { IMasterVault } from "../vaults/interfaces/IMasterVault.sol";

import "hardhat/console.sol";

struct Order {
    uint128 y; // current balance
    uint128 z; // current balance intercept
    uint64 A; // floor(ONE * (sqrt(high price) - sqrt(low price)))
    uint64 B; // floor(ONE * sqrt(low price))
}

struct EncodedStrategy {
    uint256 id;
    address provider;
    SourceTargetTokens tokens;
    uint256[3] orders;
}

struct Strategy {
    uint256 id;
    address provider;
    SourceTargetTokens tokens;
    Order[2] orders;
}

abstract contract Strategyable is Utils {
    using CountersUpgradeable for CountersUpgradeable.Counter;
    using EnumerableSetUpgradeable for EnumerableSetUpgradeable.UintSet;
    using TokenLibrary for Token;

    // unique incremental id representing a pool
    CountersUpgradeable.Counter private _lastStrategyId;

    // mapping between a strategyId to its Strategy object
    mapping(uint256 => EncodedStrategy) private _strategiesStorage;

    // mapping between a provider to its strategies ids
    mapping(address => EnumerableSetUpgradeable.UintSet) private _strategiesByProviderStorage;

    // mapping between a pool to its strategies ids
    mapping(uint256 => EnumerableSetUpgradeable.UintSet) private _strategiesByPoolStorage;
    /**
     * @dev triggered when a new pool is created
     */
    event StrategyCreated(
        uint256 id,
        address indexed provider,
        Token indexed sourceToken,
        Token indexed targetToken,
        uint128 y0, // sourceToken current balance
        uint128 z0, // sourceToken current balance intercept
        uint64 A0, // sourceToken floor(ONE * (sqrt(high price) - sqrt(low price)))
        uint64 B0, // sourceToken floor(ONE * sqrt(low price))
        uint128 y1, // targretToken current balance
        uint128 z1, // targretToken current balance intercept
        uint64 A1, // targretToken floor(ONE * (sqrt(high price) - sqrt(low price)))
        uint64 B1 // targetToken floor(ONE * sqrt(low price))
    );

    /**
     * @dev creates a new strategy
     */
    function _createStrategy(
        address masterVault,
        SourceTargetTokens memory tokens,
        Order[2] memory orders,
        Pool memory pool
    ) internal returns (uint256) {
        _depositToMasterVault(masterVault, tokens.source, msg.sender, orders[0].y);
        _depositToMasterVault(masterVault, tokens.target, msg.sender, orders[1].y);

        _lastStrategyId.increment();
        uint256 id = _lastStrategyId.current();

        _strategiesByProviderStorage[msg.sender].add(id);
        _strategiesByPoolStorage[pool.id].add(id);
        _strategiesStorage[id] = EncodedStrategy({
            id: id,
            provider: msg.sender,
            tokens: tokens,
            orders: _encodeOrders(orders)
        });

        emit StrategyCreated({
            id: id,
            provider: msg.sender,
            sourceToken: tokens.source,
            targetToken: tokens.target,
            y0: orders[0].y,
            z0: orders[0].z,
            A0: orders[0].A,
            B0: orders[0].B,
            y1: orders[1].y,
            z1: orders[1].z,
            A1: orders[1].A,
            B1: orders[1].B
        });

        return id;
    }

    // /**
    //  * @dev removes a strategy
    //  */
    // function _removeStrategy(uint256 strategyId, IMasterVault memory masterVault) internal {
    //     // Strategy memory strategy = _strategies[strategyId];
    //     // Order[2] memory orders = _decodeOrders(strategy.orders);

    //     masterVault.withdrawFunds(strategy)
    //     // Token token,
    //     // address payable target,
    //     // uint256 amount

    //     require(strategy.provider == msg.sender, "access denied");

    //     _reserveToken0.transfer(strategy.provider, orders[0].y);
    //     _reserveToken1.transfer(strategy.provider, orders[1].y);

    //     delete (_strategiesStorage[strategyId]);
    // }

    /**
     * @dev returns stored strategies matching provided strategyIds
     */
    function _strategiesByIds(uint256[] calldata strategyIds) internal view returns (Strategy[] memory) {
        uint256 length = strategyIds.length;
        Strategy[] memory result = new Strategy[](length);
        for (uint256 i = 0; i < length; i++) {
            result[i] = _strategy(strategyIds[i]);
        }
        return result;
    }

    /**
     * @dev returns stored strategies owned by a provider
     */
    function _strategiesByProvider(address provider) internal view returns (Strategy[] memory) {
        EnumerableSetUpgradeable.UintSet storage strategyIds = _strategiesByProviderStorage[provider];

        uint256 length = strategyIds.length();
        Strategy[] memory result = new Strategy[](length);
        for (uint256 i = 0; i < length; i++) {
            result[i] = _strategy(strategyIds.at(i));
        }
        return result;
    }

    /**
     * @dev returns stored strategies owned by a provider
     */
    function _strategiesByPool(Pool memory pool) internal view returns (Strategy[] memory) {
        EnumerableSetUpgradeable.UintSet storage strategyIds = _strategiesByPoolStorage[pool.id];

        uint256 length = strategyIds.length();
        Strategy[] memory result = new Strategy[](length);
        for (uint256 i = 0; i < length; i++) {
            result[i] = _strategy(strategyIds.at(i));
        }
        return result;
    }

    /**
     * @dev perform trade, update affected strategies
     *
     * requirements:
     *
     * - the caller must have approved the source token
     */
    function _trade(
        address provider,
        Trade[] calldata trades,
        bool tradeByTargetAmount,
        IMasterVault masterVault
    ) internal {
        uint256 sourceAmountTotal = 0;
        uint256 targetAmountTotal = 0;

        for (uint256 i = 0; i < trades.length; i++) {
            uint256[3] storage storageValues = _strategiesStorage[trades[i].strategyId].orders;
            uint256[3] memory memoryValues = storageValues;

            Order[2] memory orders = _decodeOrders(memoryValues);
            Order memory sourceOrder = orders[0];
            Order memory targetOrder = orders[1];

            uint128 sourceAmount;
            uint128 targetAmount;
            if (tradeByTargetAmount) {
                sourceAmount = _tradeTargetAmount(trades[i].tokenAmount, targetOrder);
                targetAmount = trades[i].tokenAmount;
            } else {
                sourceAmount = trades[i].tokenAmount;
                targetAmount = _tradeSourceAmount(trades[i].tokenAmount, targetOrder);
            }

            targetOrder.y -= targetAmount;
            sourceOrder.y += sourceAmount;
            if (sourceOrder.z < sourceOrder.y) {
                sourceOrder.z = sourceOrder.y;
            }

            uint256[3] memory newValues = _encodeOrders(orders);
            for (uint256 n = 0; n < 3; n++) {
                if (memoryValues[n] != newValues[n]) {
                    storageValues[n] = newValues[n];
                }
            }

            sourceAmountTotal += sourceAmount;
            targetAmountTotal += targetAmount;
        }

        Strategy memory firstStrategy = _strategy(trades[0].strategyId);
        Strategy memory lastStrategy = _strategy(trades[trades.length - 1].strategyId);

        _depositToMasterVault(address(masterVault), firstStrategy.tokens.source, provider, sourceAmountTotal);
        lastStrategy.tokens.target.safeTransfer(provider, targetAmountTotal);
    }

    /**
     * @dev returns:
     *
     *      x * (A * y + B * z) ^ 2
     * ---------------------------------
     *  A * x * (A * y + B * z) + z ^ 2
     *
     */
    function _tradeTargetAmount(uint256 x, Order memory curve) private pure returns (uint128) {
        uint256 temp1 = curve.y * curve.A + curve.z * curve.B;
        uint256 temp2 = (temp1 * x) / ONE;
        uint256 temp3 = temp2 * curve.A + curve.z * curve.z * ONE;
        uint256 res = MathEx.mulDivF(temp1, temp2, temp3);

        require(res <= type(uint128).max, "overflow");
        return uint128(res);
    }

    /**
     * @dev returns:
     *
     *                  x * z ^ 2
     * -------------------------------------------
     *  (A * y + B * z) * (A * y + B * z - A * x)
     *
     */
    function _tradeSourceAmount(uint256 x, Order memory curve) private pure returns (uint128) {
        uint256 temp1 = curve.z * ONE;
        uint256 temp2 = curve.y * curve.A + curve.z * curve.B;
        uint256 temp3 = temp2 - x * curve.A;
        uint256 res = MathEx.mulDivC(x * temp1, temp1, temp2 * temp3);

        require(res <= type(uint128).max, "overflow");
        return uint128(res);
    }

    /**
     * @dev encode 2 orders to a 3 slot uint256 value structure
     */
    function _encodeOrders(Order[2] memory orders) private pure returns (uint256[3] memory) {
        return [
            uint256((uint256(orders[0].y) << 0) | (uint256(orders[1].y) << 128)),
            uint256((uint256(orders[0].z) << 0) | (uint256(orders[0].A) << 128) | (uint256(orders[0].B) << 192)),
            uint256((uint256(orders[1].z) << 0) | (uint256(orders[1].A) << 128) | (uint256(orders[1].B) << 192))
        ];
    }

    /**
     * @dev decode 2 encoded orders into an array of Order types
     */
    function _decodeOrders(uint256[3] memory values) private pure returns (Order[2] memory) {
        return [
            Order({
                y: uint128(values[0] >> 0),
                z: uint128(values[1] >> 0),
                A: uint64(values[1] >> 128),
                B: uint64(values[1] >> 192)
            }),
            Order({
                y: uint128(values[0] >> 128),
                z: uint128(values[2] >> 0),
                A: uint64(values[2] >> 128),
                B: uint64(values[2] >> 192)
            })
        ];
    }

    /**
     @dev retuns a strategy object matching the provided id
     */
    function _strategy(uint256 id) internal view returns (Strategy memory) {
        EncodedStrategy memory strategy = _strategiesStorage[id];

        return
            Strategy({
                id: strategy.id,
                provider: strategy.provider,
                tokens: strategy.tokens,
                orders: _decodeOrders(strategy.orders)
            });
    }
}
