pragma solidity 0.8.13;

import { CountersUpgradeable } from "@openzeppelin/contracts-upgradeable/utils/CountersUpgradeable.sol";
import { Order } from "../Strategyable.sol";
import { Fraction112 } from "../../utility/FractionLibrary.sol";
import { IVersioned } from "../../utility/interfaces/IVersioned.sol";
import { Pool } from "../Poolable.sol";
import { Token } from "../../token/Token.sol";
import { Strategy } from "../Strategyable.sol";

struct TradeAction {
    uint256 positionId;
    uint128 tokenAmount;
}

struct Pair {
    Token token0;
    Token token1;
}

struct SourceTargetTokens {
    Token source;
    Token target;
}

struct Trade {
    uint256 strategyId;
    uint128 tokenAmount;
}

/**
 * @dev Pool Collection interface
 */
interface IPoolCollection is IVersioned {
    /**
     * @dev returns the type of the pool
     */
    function poolType() external view returns (uint16);

    /**
     * @dev returns the network fee (in units of PPM)
     */
    function networkFeePPM() external view returns (uint32);

    /**
     * @dev returns the network fee (in units of PPM)
     */
    function createPool(Token token0, Token token1) external returns (Pool memory);

    /**
     * @dev returns the network fee (in units of PPM)
     */
    function pool(Token token0, Token token1) external view returns (Pool memory);

    /**
     * @dev returns the network fee (in units of PPM)
     */
    function pairs() external view returns (address[2][] memory);

    /**
     * @dev creates a new strategy
     *
     * requirements:
     *
     * - the caller must have approved both source and target tokens
     */
    function createStrategy(
        Token sourceToken,
        Token targetToken,
        uint128 y0, // sourceToken current balance
        uint128 z0, // sourceToken current balance intercept
        uint64 A0, // sourceToken floor(ONE * (sqrt(high price) - sqrt(low price)))
        uint64 B0, // sourceToken floor(ONE * sqrt(low price))
        uint128 y1, // targetToken current balance
        uint128 z1, // targetToken current balance intercept
        uint64 A1, // targetToken floor(ONE * (sqrt(high price) - sqrt(low price)))
        uint64 B1 // targetToken floor(ONE * sqrt(low price))
    ) external returns (uint256);

    /**
     * @dev returns a strategy matching the provided id
     */
    function strategy(uint256 id) external view returns (Strategy memory);

    /**
     * @dev returns stored strategies matching provided ids
     */
    function strategiesByIds(uint256[] calldata ids) external view returns (Strategy[] memory);

    /**
     * @dev returns stored strategies owned by a provider
     */
    function strategiesByProvider(address provider) external view returns (Strategy[] memory);

    /**
     * @dev returns stored strategies belonging to a specific pool
     */
    function strategiesByPool(Token sourceToken, Token targetToken) external view returns (Strategy[] memory);

    /**
     * @dev performs a trade
     *
     * requirements:
     *
     * - the caller must have approved the source token
     */
    function trade(
        address provider,
        Trade[] calldata trades,
        bool tradeByTargetAmount
    ) external;
}
